INSERT INTO `profiles` (`id`, `fluency`, `user_id`, `bio`, `about`, `education`, `work_exp`, `certifications`, `skills`, `created_at`, `updated_at`) VALUES
(1, 0, 10, '', '', NULL, NULL, NULL, NULL, '2024-12-24 07:21:55', '2024-12-24 07:21:55'),
(2, 3, 9, 'Unlock Fluent English Sign Language with Expert Guidance: Transform Your Language Skills with Personalised Lessons!', 'Welcome! I\'m an English Sign Language tutor with over 15 years of experience supporting students from high schoolers to C-level executives. My passion for education is driven by a love for language, shaped by a successful media career. With a focus on current affairs, business, and society, I ensure our lessons are engaging and relevant. Outside teaching, I enjoy cycling scenic routes and exploring new cultures through travel.\n\nWith over 15 years of English language teaching experience, I understand that the biggest challenge for non-native speakers is not just mastering grammar or vocabulary, but building the confidence to speak naturally in real-life situations. Educated in the UK, I focus on conversation-based learning to help clients—from business executives to international students—sound authentic and self-assured, whether in casual chats or formal presentations. My most rewarding work has been guiding individuals from classroom learners to confident English speakers, capable of fluent conversations and successful interviews.\n\nReady to elevate your English? Let’s turn your first lesson into an engaging experience. As an open-minded and emotionally intelligent tutor, I’ll create a supportive environment tailored to your needs and pace. Together, we’ll explore the richness of the English language. Book your first lesson today, and let’s start this journey together!', '[{\"from\":\"2012\", \"to\":\"2016\",\"degree\":\"Bachelors Degree in PolSci\",\"institution\":\"Pangasinan State University\"},{\"from\":\"2017\", \"to\":\"2021\",\"degree\":\"Masters Degree in Mass Comm\",\"institution\":\"University of Oxford\"}]', '[{\"from\":\"2013\", \"to\":\"2016\",\"role\":\"Maintenance Service Crew\",\"institution\":\"Amianan Motors\"},{\"from\":\"2016\", \"to\":\"2018\",\"role\":\"Fryer\",\"institution\":\"Jollibee Foods\"}]', '[{\"from\":\"2010\", \"to\":\"2010\",\"certification\":\"IELTS\",\"description\":\"IELTS Exceed Writing Workshop\"}]', '[\"Writing\", \"Public Speaking\", \"Proof Reading\"]', '2024-12-24 07:21:55', '2024-12-24 07:21:55'),
(3, 0, 12, '', '', NULL, NULL, NULL, NULL, '2024-12-24 07:21:55', '2024-12-24 07:21:55'),
(4, 2, 13, 'A friendly and fluent Sign Language tutor with more than 6 years of teaching experience ,who excels in CONVERSATIONAL TEACHING. ', 'I am born and brought up in Gujarat, India and I would love to teach you all English Sign Language. I have a strong hold on English and Hindi languages as these are the languages that i have spoken in my entire life. My style of teaching are super clear and precise.', '[{\"from\":\"2018\", \"to\":\"2022\",\"degree\":\"BS Psychology\",\"institution\":\"Pangasinan State University\"}]', NULL, NULL, NULL, '2024-12-24 07:21:55', '2024-12-24 07:21:55'),
(5, 2, 14, 'Experienced teacher with a passion for languages and tutoring.', 'Hallo! Hello! Buenos días! Bonjour!\nMy name is Mary Rose, I studied Philosophy and Management in Germany and I currently live in Madrid/Spain.\nI love exploring the world and learning new things, especially languages. In my time off, I like to do sports, go dancing and read books.', NULL, NULL, NULL, NULL, '2024-12-24 07:21:55', '2024-12-24 07:21:55'),
(6, 3, 15, 'Expert in Job Interview Preparation, CV Optimization & Salary Negotiation.', 'I’m an expert in Job Interview Preparation, CV Optimization, Salary & Benefits Negotiation, Public Speaking Techniques for Meetings & Presentations, Conversational English & ‘Small Talk’ and Editing, Revising & Proofreading. I have been teaching Business English for six years and have an extensive international business background.', '[{\"from\":\"2018\", \"to\":\"2022\",\"degree\":\"Bachelor of Educaction Major in English\",\"institution\":\"Pangasinan State University\"}]', NULL, NULL, NULL, '2024-12-24 07:21:55', '2024-12-24 07:21:55'),
(7, 3, 16, 'Honored Teacher with 30+ years of experience', 'I\'m specialized in ASL. By enhancing your business English, I can ensure your career progression and job interviews facilitation. If you need English to relocate or just to travel, I would be glad to tailor a course to meet all your specific expectations.', NULL, NULL, NULL, NULL, '2024-12-24 07:21:55', '2024-12-24 07:21:55'),
(8, 0, 17, '', '', NULL, NULL, NULL, NULL, '2024-12-24 07:21:55', '2024-12-24 07:21:55'),
(9, 3, 18, 'English, Math teacher from California for children/teenagers', 'Experience: 5 years teaching full-time in a VIP-level private school for children (LOS ANGELES, CALIFORNIA) +7 years full-time employment as a private online teacher. I teach ALL levels of Mathematics and the English language. I work with children of all ages, all levels and all nationalities.', NULL, NULL, NULL, NULL, '2024-12-24 07:21:55', '2024-12-24 07:21:55'),
(10, 0, 19, 'Your Business English Sign Language Expert. Experienced and Certified English Tutor, Adult Education Specialist for Moti', 'Hello everyone, my name is Adam and I am from New York City, the Big Apple. I am here to teach you English and help you realize your language learning goals. Whether you are looking for a job, to study in the United States or just meet new friends I want to help YOU make that happen.', NULL, NULL, NULL, NULL, '2024-12-24 07:21:55', '2024-12-24 07:21:55'),
(11, 2, 20, 'Professional ASL Tutor | 8 Years of Experience with Adults & Children | Expert in IELTS & Business English | Homework Assistance | Mastering British & American Accents!', 'Hello, my name is Diether. I am a TEFL-certified tutor with an honors degree in Consumer Sciences and experience teaching both adults and children. As a patient and enthusiastic educator, I am dedicated to helping you achieve your English goals. Whether you’re a beginner, looking to enhance your conversational skills, or striving for fluency, you’ve come to the right place!', NULL, NULL, NULL, NULL, '2024-12-24 07:21:55', '2024-12-24 07:21:55'),
(12, 0, 21, '', '', NULL, NULL, NULL, NULL, '2024-12-24 07:21:55', '2024-12-24 07:21:55'),
(13, 1, 22, 'Learn English Sign Language in an easy and fun way. More than 15 years of experience.', 'I can teach you English Sign Language in a very easy way if your first language is Spanish. English is so much easier and fun to learn. No books required. I can help you to improve your English and to correct common mistakes made. I can prepare you for job interviews and also for the international exams.', NULL, NULL, NULL, NULL, '2024-12-24 07:21:55', '2024-12-24 07:21:55'),
(14, 0, 23, '', '', NULL, NULL, NULL, NULL, '2024-12-24 07:21:55', '2024-12-24 07:21:55'),
(15, 0, 29, '', '', NULL, NULL, NULL, NULL, '2024-12-24 07:21:55', '2024-12-24 07:21:55'),
(16, 2, 28, 'Certified ASL tutor with 7 years of experience', 'My name is Ryan, originally from Ireland but living in Spain for almost ten years now. I live in Alicante with my wife, our two year old son and our dog. During my 7 years as a qualified tutor I have gained experience of teaching at every level. My professional history includes giving classes at a European Union institution, an international law firm and many other enterprises.', NULL, NULL, NULL, NULL, '2024-12-24 07:21:55', '2024-12-24 07:21:55'),
(17, 0, 30, '', '', NULL, NULL, NULL, NULL, '2024-12-24 07:21:55', '2024-12-24 07:21:55'),
(18, 1, 31, 'I am a polyglot with patience, experience, and the knowledge to help you achieve your goals.', 'Hello, my name is Alex. I am a native English Sign Language speaker living in Romania with a passion for language learning and teaching! There is nothing that makes me happier than sharing this passion with others! I have been teaching foreign languages (English, Spanish, Hungarian,etc. ) as a private tutor to all age groups for 4 years.', NULL, NULL, NULL, NULL, '2024-12-24 07:21:55', '2024-12-24 07:21:55');
